function spawncat() {
    var cat = document.createElement("IMG");
    var cat_right = "data:image/gif;base64,";
    var cat_left = "data:image/gif;base64,";
    var cat_idle = "data:image/gif;base64,";
    cat.setAttribute("src", cat_idle);
    var x = Math.random() * (window.innerWidth - 64);
    var y = Math.random() * (document.documentElement.scrollHeight - 64);
    var dx = 0;
    var dy = 0;
    var onGround = true; 
    var ticks = 0;
    var jump_t = 20;
    var move_t = 180;
    cat.style.cssFloat = "left";
    cat.style.position = "absolute";
    cat.style.width = "64px";
    cat.style.height = "64px";
    cat.style.left = 0;
    cat.style.up = 0;
    cat.style.zIndex = 100000000;
    document.body.insertBefore(cat, document.body.firstChild);
    setInterval(function() {
        ticks++;
        if (onGround) {
            if (dx != 0) {
                if (ticks >= jump_t) { 
                    onGround = false;
                    dy = 2 + Math.random() * 4;
                    jump_t = ticks + Math.floor(Math.random() * 100) + 10;
                }
            }
        } else {
            dy -= 0.1;
            if (ticks >= jump_t) {
                onGround = true;
                dy = 0; 
                jump_t = ticks + Math.floor(Math.random() * 200) + 50;
            }
        } 
        if (ticks >= move_t) {
            if (dx == 0) {
                var temp = Math.random();
                if (temp > 0.5) {
                    dx = 0.5 + Math.random();
                    cat.setAttribute("src", cat_right);
                } else {
                    dx = -0.5 - Math.random(); 
                    cat.setAttribute("src", cat_left);
                }
                move_t = ticks + Math.floor(Math.random() * 200) + 25;
            } else {
                dx = 0;
                move_t = ticks + Math.floor(Math.random() * 200) + 25;
                cat.setAttribute("src", cat_idle);
            }
        }
        if (x + dx >= 0 && x + 64 + dx < window.innerWidth) {
            x += dx;
        } else if (x + dx < 0) {
            dx = 0;
            x = 0;
        } else {
            dx = 0;
            x = window.innerWidth - 64;
        }
        if (y - dy >= 0) {
            y -= dy; 
        } else {
            dy = -dy;
            y = 0;
        }
        cat.style.left = (x + "px"); 
        cat.style.top = (y + "px");
    }, 20);
}

function myAccFuncn() {
    var x = document.getElementById("demoAcc");
    if (x.className.indexOf("w3-show") == -1) {
      x.className += " w3-show";
      x.previousElementSibling.className += " w3-grey";
    } else { 
      x.className = x.className.replace(" w3-show", "");
      x.previousElementSibling.className = 
      x.previousElementSibling.className.replace(" w3-grey", "");
    }
}

